import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

let name = 'Ryan'
let green = '#ff1212'
let headerStyle = {color: green, 'font-size': '50px'}

class Filter extends Component {
  render(){
    return(
      <div> 
        <img/>
        <input type="text"/>
        Filter
      </div>
    )
  }
}

class Aggregate extends Component{
  render(){
    return(
      <div style={{color: '#ccc'}}><h2>Number Text</h2></div>
    )
  }
}
function App() {

  return (
    <div className="App">
      <h1>Title</h1>
      <Aggregate />
    </div>
  );
}

export default App;
